sys_variable_value.value:
(function execute(inputs, outputs) {
    var orderHeader = JSON.parse(inputs.orderHeader);
    orderHeader.billTo = {
        "address1": inputs.billToaddress1,
        "address2": inputs.billToaddress2,
        "city": inputs.billTocity,
        "country": inputs.billTocountry,
        "emailId": inputs.billToemailId,
        "name": inputs.billToName,
        "postalCode": inputs.billTopostalCode,
        "state": inputs.billTostate,
        "street": inputs.billTostreet
    }
    orderHeader.shipTo = {
        "address1": inputs.shipToAddress1.toString().substring(0,34),
        "address2": inputs.shipToAddress2,
        "city": inputs.shipToCity,
        "country": inputs.shipToCountry,
        "deliverTo": inputs.shipToDeliverTo,
        "emailId": inputs.shipToEmailId,
        "firstName": inputs.shipToFirstName,
        "lastName": inputs.shipToLastName,
        "postalCode": inputs.shipToPostalCode,
        "state": inputs.shipToState,
        "street": inputs.shipToStreet,
        "telephoneNumber": inputs.shipToPhoneNumber
    }

    var orderLines = JSON.parse(inputs.orderLines);
    outputs.order = JSON.stringify({
        "orderHeader": orderHeader,
        "orderLines": orderLines
    });

})(inputs, outputs);

